          return res.json()
        })
        .then((res) => {
          this.setState({
            data: res.results
          })
        })
    }

    displayAll(pics){
        console.log("you made it here: ", pics)
        const newPics = pics.map(
          console.log(pics)
        )
        return newPics
    }


    render(){
      return (
        <div>
            <button onClick={this.getPictures}>Click Me</button>
            {this.displayAll(this.state.data)}
        </div>
      )
    }
}

